import React from "react";
import Header  from "./Header";
import emoji from './emojipedia';


function App() {
  return (
        <div>
        <Header />
    <div className="dictionary">

    {emoji.map((a)=>{
      return (

        <div className="term">
          <span className="span">{a.emoji}</span>
          <dt>{a.name}</dt>
          <dd>{a.meaning}</dd>
        </div>
      )
    })}
    </div>



        </div>
  )
}

export default App;
